import React from 'react';
import PlanetCard from './PlanetCard'
import './Content.css'

const Content = ({ planets, showModal, hideModal }) => {
    return (
        <div className="content">
            {planets.map((planet,i) => {
                return (
                    <PlanetCard key={planet.name} id={i} name={planet.name} showModal = {showModal} hideModal = {hideModal}/>
                );
            })}
        </div>
    );
}

export default Content;
